INSERT INTO `v1_2e9b7974577f4554722366c1b085e3f86f0fb81e94fca833aaca39000f647263` VALUES (3, 1, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 1, 6000, "アサヒ", "---", 0, "", 2);
INSERT INTO `v1_2e9b7974577f4554722366c1b085e3f86f0fb81e94fca833aaca39000f647263` VALUES (0, 3, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 1, 16000, "部員3", "アドレナリン", 3, "ホームランを連発すると、連発数に応じてパワーアップする", 3);
INSERT INTO `v1_2e9b7974577f4554722366c1b085e3f86f0fb81e94fca833aaca39000f647263` VALUES (2, 2, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 1, 30000, "{0}", "ラッキー", 2, "幸運のハプニングを呼び込む", 4);
INSERT INTO `v1_2e9b7974577f4554722366c1b085e3f86f0fb81e94fca833aaca39000f647263` VALUES (1, 0, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", 0, 50000, "選手名鑑 おまけページ", "", 1, "", 5);
